import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');

    // Take screenshot after typing search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_typed_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_typed_search.png'));

    // Wait for the search button (use class, as there are multiple, pick the first visible)
    const searchBtn = await page.waitForSelector('.search-btn', { timeout: 5000 });
    await searchBtn.click();

    // Wait for search results header
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract product titles from the results (first 5)
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.slice(0, 5).map(n => n.textContent.trim())
    );

    // Extract number of results from the results count element
    let resultsCount = null;
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch (e) {
      resultsCount = null;
    }

    return {
      success: true,
      action: "Searched for 'iPhone' products and extracted search result titles",
      extractedData: {
        productTitles,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
